<template>
	<view class="login">
		<view class="title">
			<text>管理平台</text>
			<u-divider text="欢迎登录" :hairline="false" textSize="16" textColor="#FEFEFE" lineColor="#FFFFFF"></u-divider>
		</view>
		<view class="content">
			<view class="form">
				<u--form :model="formData" :rules="rules" ref="mainForm">
					<!--  :errorType="'toast'" -->
					<u-form-item prop="CellPhone">
						<u--input v-model="formData.CellPhone" maxlength="11" prefixIcon="phone-fill"
							prefixIconStyle="color: #177AD2" placeholder="请输入手机号码"></u--input>
					</u-form-item>
					<u-form-item prop="Password">
						<u--input type="password" v-model="formData.Password" prefixIcon="lock-fill"
							prefixIconStyle="color: #177AD2" placeholder="请输入密码">
						</u--input>
					</u-form-item>
				</u--form>
				<view class="btn-login">
					<u-button type="default" class="btn-login" @click="login" text="立即登录">
					</u-button>
				</view>
				<!-- #ifdef MP-WEIXIN -->
				<view class="thrid-login">
					<button openType="getPhoneNumber" @getphonenumber="getPhoneNumber" class="u-reset-button">
						<!-- <u-icon name="weixin-fill" color="#95EC69" size="28"></u-icon> 不能加logo，不然审核不通过 -->
						<view class="text">手机号一键登录</view>
					</button>
				</view>
				<!-- #endif -->
			</view>
		</view>
	</view>
</template>

<script>
	export default {
		data() {
			var validCellPhone = (rule, value, callback) => {
				return uni.$u.const.RegEx_CellPhone.test(value);
			};
			return {
				redirect: '', //登录成功后的跳转地址
				formData: {
					CellPhone: '13000000000',
					Password: '000',
					From: "mp"
				},
				rules: {
					CellPhone: [{
						required: true,
						message: '请输入手机号码',
						trigger: ['blur', 'change']
					}, {
						validator: validCellPhone,
						message: '手机号码不正确',
						trigger: ['blur', 'change']
					}],
					Password: [{
							required: true,
							message: '请输入密码',
							trigger: ['blur', 'change']
						},
						{
							min: 3,
							max: 30,
							message: '密码长度在3-30之间',
							// trigger: ['blur', 'change']
						}
					]
				}
			}
		},
		onReady() {
			this.$refs.mainForm.setRules(this.rules)
		},
		onLoad(option) {
			console.log('环境：' + process.env.NODE_ENV + '，平台：' + uni.getSystemInfoSync().platform);
			this.redirect = decodeURIComponent(option.redirect || '')
			// 清空保存的信息  && uni.getSystemInfoSync().platform === 'devtools'
			this.$store.commit('logout')
			if (process.env.NODE_ENV === 'development') {
				this.formData.CellPhone = '13000000000'
				this.formData.Password = '000'
			}
		},
		methods: {
			// 微信手机号授权登录
			async getPhoneNumber(e) {
				if (!e.detail.code) {
					this.$u.toast("用户取消授权")
					return;
				}
				console.log(e.detail.code) // 动态令牌
				let that = this;
				uni.showLoading()
				//1. 获取token (只要方法中reject错误，就toast出来，然后重新抛出这个异常，让下面的接口不再继续执行)
				await this.loadTokenByCode(e.detail.code).then(res => {
					this.$store.commit('setToken', res)
				}).catch((error) => {
					this.$u.toast(error)
					throw error
				});
				//公共步骤
				await this.afterLogin();
			},
			async login() {
				await this.$refs.mainForm.validate().catch(errors => {
					this.$u.toast('信息输入有误')
					throw errors
				});
				uni.showLoading()
				//1. 获取token (只要方法中reject错误，就toast出来，然后重新抛出这个异常，让下面的接口不再继续执行)
				await this.loadToken().then(res => {
					this.$store.commit('setToken', res)
				}).catch((error) => {
					this.$u.toast(error)
					throw error
				});
				//公共步骤
				await this.afterLogin();
			},
			async afterLogin() {
				//2. 拉取用户基本信息
				await this.loadUserInfo().then(res => {
					this.$store.commit('setUserInfo', res)
				}).catch((error) => {
					this.$u.toast(error)
					throw error
				});
				// 3. 拉取权限列表
				await this.loadPermissions().then(res => {
					this.$store.commit('setPermissions', res)
				}).catch((error) => {
					this.$u.toast(error)
					throw error
				});
				console.log('登录涉及到的接口全部请求完毕！');
				uni.hideLoading()
				this.$u.toast('登录成功')
				if (this.redirect) {
					uni.setStorageSync('jump', this.redirect);
				};
				uni.switchTab({
					url: "/pages/index/index"
				});
			},
			loadToken() {
				return new Promise((resolve, reject) => {
					let that = this
					uni.$u.http.post('/api/Account/Login', this.formData).then(res => {
						if (res.Data) {
							resolve(res.Data)
						} else {
							reject(new Error('远程未返回令牌'))
						}
					})
				})
			},
			//手机号登录
			loadTokenByCode(code) {
				return new Promise((resolve, reject) => {
					let that = this
					uni.$u.http.get('/api/Account/wx/applet/phonecode', {
						params: {
							phoneCode: code,
							fakePhone: this.formData.CellPhone
						}
					}).then(res => {
						if (res.Data) {
							resolve(res.Data)
						} else {
							reject(new Error('远程未返回令牌'))
						}
					})
				})
			},
			//加载用户信息
			loadUserInfo() {
				return new Promise((resolve, reject) => {
					uni.$u.http.post('/api/Current/get/user/info').then(res => {
						if (res.Data) {
							resolve(res.Data)
						} else {
							reject(new Error('远程返回的用户信息有误'))
						}
					})
				})

			},
			//加载用户权限
			loadPermissions() {
				return new Promise((resolve) => {
					uni.$u.http.get('/api/Current/get/permission/list').then(res => {
						if (res.Data) {
							resolve(res.Data)
						} else {
							reject(new Error('权限信息获取失败'))
						}
					})
				})
			},
			// setPwdInputType() {
			// 	console.log('当前：' + this.passwordInputType);
			// 	if (this.passwordInputType == 'text') {
			// 		this.passwordInputType = 'password'
			// 	} else {
			// 		this.passwordInputType = 'text'
			// 	}
			// 	// this.$forceUpdate();
			// }
		}
	}
</script>

